// import Footer from '../Footer'; // Adjust the import path as per your project structure
import './home.css'; // Adjust the import path for your CSS file

function Home() {
  return (
    <div className="home-container">
      <section className="section bg-c-light border-top">
        <div className="container">
          <div className="row">
            <div className="col-md-12 mb-4">
              <div className="maroon-box shadow p-4">
                <h1>Welcome to Our Store</h1>
                <p>Explore our exclusive collection of elegantaccessories and more.</p>
              </div>
            </div>
          </div>
          <div className="row">
            <div className="col-md-4">
              <div className="card shadow">
                {/* <img src={necklesImage} className='w-100 border-bottom' alt='accessories' /> */}
                <div className="card-body">
                  {/* Add any content for the card body here */}
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Footer Section */}
      {/* <Footer /> */}
    </div>
  );
}

export default Home;
